	public int runJobInTOS(String[] args) {
		// reset status
		status = "";

		String lastStr = "";
		for (String arg : args) {
			if (arg.equalsIgnoreCase("--context_param")) {
				lastStr = arg;
			} else if (lastStr.equals("")) {
				evalParam(arg);
			} else {
				evalParam(lastStr + " " + arg);
				lastStr = "";
			}
		}
		enableLogStash = "true".equalsIgnoreCase(System.getProperty("monitoring"));

		if (clientHost == null) {
			clientHost = defaultClientHost;
		}

		if (pid == null || "0".equals(pid)) {
			pid = TalendString.getAsciiRandomString(6);
		}

		if (rootPid == null) {
			rootPid = pid;
		}
		if (fatherPid == null) {
			fatherPid = pid;
		} else {
			isChildJob = true;
		}

		if (portStats != null) {
			// portStats = -1; //for testing
			if (portStats < 0 || portStats > 65535) {
				// issue:10869, the portStats is invalid, so this client socket can't open
				System.err.println("The statistics socket port " + portStats + " is invalid.");
				execStat = false;
			}
		} else {
			execStat = false;
		}

		try {
			// call job/subjob with an existing context, like: --context=production. if
			// without this parameter, there will use the default context instead.
			java.io.InputStream inContext = test_null.class.getClassLoader()
					.getResourceAsStream("prise_en_main/test_null_0_1/contexts/" + contextStr + ".properties");
			if (inContext == null) {
				inContext = test_null.class.getClassLoader()
						.getResourceAsStream("config/contexts/" + contextStr + ".properties");
			}
			if (inContext != null) {
				// defaultProps is in order to keep the original context value
				if (context != null && context.isEmpty()) {
					defaultProps.load(inContext);
					context = new ContextProperties(defaultProps);
				}

				inContext.close();
			} else if (!isDefaultContext) {
				// print info and job continue to run, for case: context_param is not empty.
				System.err.println("Could not find the context " + contextStr);
			}

			if (!context_param.isEmpty()) {
				context.putAll(context_param);
				// set types for params from parentJobs
				for (Object key : context_param.keySet()) {
					String context_key = key.toString();
					String context_type = context_param.getContextType(context_key);
					context.setContextType(context_key, context_type);

				}
			}
			class ContextProcessing {
				private void processContext_0() {
					context.setContextType("ConnexionOracle_Sid", "id_String");
					context.ConnexionOracle_Sid = (String) context.getProperty("ConnexionOracle_Sid");
					context.setContextType("ConnexionOracle_Password", "id_Password");
					String pwd_ConnexionOracle_Password_value = context.getProperty("ConnexionOracle_Password");
					context.ConnexionOracle_Password = null;
					if (pwd_ConnexionOracle_Password_value != null) {
						if (context_param.containsKey("ConnexionOracle_Password")) {// no need to decrypt if it come
																					// from program argument or parent
																					// job runtime
							context.ConnexionOracle_Password = pwd_ConnexionOracle_Password_value;
						} else if (!pwd_ConnexionOracle_Password_value.isEmpty()) {
							try {
								context.ConnexionOracle_Password = routines.system.PasswordEncryptUtil
										.decryptPassword(pwd_ConnexionOracle_Password_value);
								context.put("ConnexionOracle_Password", context.ConnexionOracle_Password);
							} catch (java.lang.RuntimeException e) {
								// do nothing
							}
						}
					}
					context.setContextType("ConnexionOracle_AdditionalParams", "id_String");
					context.ConnexionOracle_AdditionalParams = (String) context
							.getProperty("ConnexionOracle_AdditionalParams");
					context.setContextType("ConnexionOracle_Port", "id_String");
					context.ConnexionOracle_Port = (String) context.getProperty("ConnexionOracle_Port");
					context.setContextType("ConnexionOracle_Login", "id_String");
					context.ConnexionOracle_Login = (String) context.getProperty("ConnexionOracle_Login");
					context.setContextType("ConnexionOracle_Server", "id_String");
					context.ConnexionOracle_Server = (String) context.getProperty("ConnexionOracle_Server");
					context.setContextType("ConnexionOracle_Schema", "id_String");
					context.ConnexionOracle_Schema = (String) context.getProperty("ConnexionOracle_Schema");
				}

				public void processAllContext() {
					processContext_0();
				}
			}

			new ContextProcessing().processAllContext();
		} catch (java.io.IOException ie) {
			System.err.println("Could not load context " + contextStr);
			ie.printStackTrace();
		}

		// get context value from parent directly
		if (parentContextMap != null && !parentContextMap.isEmpty()) {
			if (parentContextMap.containsKey("ConnexionOracle_Sid")) {
				context.ConnexionOracle_Sid = (String) parentContextMap.get("ConnexionOracle_Sid");
			}
			if (parentContextMap.containsKey("ConnexionOracle_Password")) {
				context.ConnexionOracle_Password = (java.lang.String) parentContextMap.get("ConnexionOracle_Password");
			}
			if (parentContextMap.containsKey("ConnexionOracle_AdditionalParams")) {
				context.ConnexionOracle_AdditionalParams = (String) parentContextMap
						.get("ConnexionOracle_AdditionalParams");
			}
			if (parentContextMap.containsKey("ConnexionOracle_Port")) {
				context.ConnexionOracle_Port = (String) parentContextMap.get("ConnexionOracle_Port");
			}
			if (parentContextMap.containsKey("ConnexionOracle_Login")) {
				context.ConnexionOracle_Login = (String) parentContextMap.get("ConnexionOracle_Login");
			}
			if (parentContextMap.containsKey("ConnexionOracle_Server")) {
				context.ConnexionOracle_Server = (String) parentContextMap.get("ConnexionOracle_Server");
			}
			if (parentContextMap.containsKey("ConnexionOracle_Schema")) {
				context.ConnexionOracle_Schema = (String) parentContextMap.get("ConnexionOracle_Schema");
			}
		}

		// Resume: init the resumeUtil
		resumeEntryMethodName = ResumeUtil.getResumeEntryMethodName(resuming_checkpoint_path);
		resumeUtil = new ResumeUtil(resuming_logs_dir_path, isChildJob, rootPid);
		resumeUtil.initCommonInfo(pid, rootPid, fatherPid, projectName, jobName, contextStr, jobVersion);

		List<String> parametersToEncrypt = new java.util.ArrayList<String>();
		parametersToEncrypt.add("ConnexionOracle_Password");
		// Resume: jobStart
		resumeUtil.addLog("JOB_STARTED", "JOB:" + jobName, parent_part_launcher, Thread.currentThread().getId() + "",
				"", "", "", "", resumeUtil.convertToJsonText(context, parametersToEncrypt));

		if (execStat) {
			try {
				runStat.openSocket(!isChildJob);
				runStat.setAllPID(rootPid, fatherPid, pid, jobName);
				runStat.startThreadStat(clientHost, portStats);
				runStat.updateStatOnJob(RunStat.JOBSTART, fatherNode);
			} catch (java.io.IOException ioException) {
				ioException.printStackTrace();
			}
		}

		java.util.concurrent.ConcurrentHashMap<Object, Object> concurrentHashMap = new java.util.concurrent.ConcurrentHashMap<Object, Object>();
		globalMap.put("concurrentHashMap", concurrentHashMap);

		long startUsedMemory = Runtime.getRuntime().totalMemory() - Runtime.getRuntime().freeMemory();
		long endUsedMemory = 0;
		long end = 0;

		startTime = System.currentTimeMillis();

		this.globalResumeTicket = true;// to run tPreJob

		this.globalResumeTicket = false;// to run others jobs

		try {
			errorCode = null;
			tFileInputDelimited_1Process(globalMap);
			if (!"failure".equals(status)) {
				status = "end";
			}
		} catch (TalendException e_tFileInputDelimited_1) {
			globalMap.put("tFileInputDelimited_1_SUBPROCESS_STATE", -1);

			e_tFileInputDelimited_1.printStackTrace();

		}

		this.globalResumeTicket = true;// to run tPostJob

		end = System.currentTimeMillis();

		if (watch) {
			System.out.println((end - startTime) + " milliseconds");
		}

		endUsedMemory = Runtime.getRuntime().totalMemory() - Runtime.getRuntime().freeMemory();
		if (false) {
			System.out.println((endUsedMemory - startUsedMemory) + " bytes memory increase when running : test_null");
		}

		if (execStat) {
			runStat.updateStatOnJob(RunStat.JOBEND, fatherNode);
			runStat.stopThreadStat();
		}
		int returnCode = 0;
		if (errorCode == null) {
			returnCode = status != null && status.equals("failure") ? 1 : 0;
		} else {
			returnCode = errorCode.intValue();
		}
		resumeUtil.addLog("JOB_ENDED", "JOB:" + jobName, parent_part_launcher, Thread.currentThread().getId() + "", "",
				"" + returnCode, "", "", "");

		return returnCode;

	}

